pragma solidity >=0.5.0 <0.7.0;
pragma experimental ABIEncoderV2;


import "./AufToken.sol";
import "./AufNFT.sol";

contract AufGame is Ownable{
    string public name = "AUF game core v0.3.0";
    AufToken public aufToken;
    AufNFT public aufNFT;
    uint256 private constant max_players = 15;
    uint256 private constant min_players = 6;
    uint256 private constant max_rooms = 1000; //enough for v0.3.0 
    uint256 private constant err_rooms = 54321;    
    uint256 private constant err_players = 21;

   event Log(string a);
   event CurrentStatus(string room_id, string text_);
   event RoomCreated(string room_id, address player_);
   event JoinedToRoom(string room_id, address player_);
   event BetPlaced(string room_id, uint256 a, uint256 b);

    enum Status { 
        GAME,
        ACTIVE,
        INACTIVE
    } 
    struct Room {
        string roomID;
        Status status;
        bool full;
        bool exists;
        uint256 pindex;
        uint256 bank;
        uint256 wins;
        uint256 bids_count;
        uint256 payments_count;
        uint256 bids_limit;
        Player[max_players] players;
    }

    struct Player {
        address adr;
        string username;
        bool bidder;
        uint256 bids_amount;
    }

    Room[max_rooms] private rooms;
    uint256 private rindex = 0;
    uint256 private min_stake = 1000000000000000000000; //1k AMONG tokens
    address burnaddr = 0x000000000000000000000000000000000000000d;

    constructor(AufToken _aufToken, AufNFT _aufNFT) public {
        aufToken = _aufToken;
        aufNFT = _aufNFT;
    }

    function findRindex(string memory room_id) public view returns(uint256) {
        for (uint256 i = 0; i < max_rooms; i++) {  
            if (rooms[i].exists) {        
            if (keccak256(abi.encodePacked(rooms[i].roomID)) == keccak256(abi.encodePacked(room_id))) {
                return(i);
            }
            }
        }
        return(err_rooms);
    }

    function roomBank(string memory room_id) public view returns(uint256) {
        uint256 rindex_ = findRindex(room_id);
        if (rindex_ != err_rooms) { //room exists
        uint256 bank_ = rooms[rindex_].bank;
        return (bank_);
        }
        return (0);
    }

    function roomLimit(string memory room_id) public view returns(uint256) {
        uint256 rindex_ = findRindex(room_id);
        if (rindex_ != err_rooms) { //room exists
        uint256 limit_ = rooms[rindex_].bids_limit;
        return (limit_);
        }
        return (0);
    }

    function bidsCount(string memory room_id) public view returns(uint256) {
        uint256 rindex_ = findRindex(room_id);
        if (rindex_ != err_rooms) { //room exists
        uint256 count_ = rooms[rindex_].bids_count;
        return (count_);
        }
        return (0);
    }


    function findPindex(string memory room_id, address account) public view returns(uint256) {
        uint256 rindex_ = findRindex(room_id); 
        if (rindex_ != err_rooms) { //room exists
        for (uint256 i = 0; i < max_players; i++) { 
            if (rooms[rindex_].players[i].adr == account) {
                return(i);
            }
        }
        }
        return(err_players);
    }

    function roomStatus(string memory room_id) public view returns (uint256) {
        uint256 rindex_ = findRindex(room_id); 
        if (rindex_ == err_rooms) {
            return (0); //not exisits
        }
        if (rooms[rindex_].status == Status.ACTIVE) {
            return (1); //active
        }
        if (rooms[rindex_].status == Status.INACTIVE) {
            return (2); //game
        }
        if (rooms[rindex_].status == Status.GAME) {
            return (3); //inactive
        }  
    } 

    modifier onlyPlayer(string memory room_id) {
        uint256 pindex_ = findPindex(room_id, msg.sender);
        require(pindex_ != err_players, "Not registered in this room");
    _;
    }

    modifier onlyRoomCreator(string memory room_id) {
        uint256 pindex_ = findPindex(room_id, msg.sender);
        require(pindex_ == 0, "You are not creator of this room");
    _;
    }

    modifier checkBid(uint256 bid) {
        require(bid >= min_stake, "Require bid >= 1000 AMONG");
    _;
    }

    function createRoom(string calldata room_id, string calldata player_name, uint256 nftid, uint256 bidslimit) external {
        require (rindex < max_rooms, "v0.3.1 released");
        require (bidslimit >= min_stake);
        uint256 rindex_ = findRindex(room_id);
        require(rindex_ == err_rooms, "Room already exists");
        require(aufNFT.ownerOf(nftid) == msg.sender, "You are not owner of this ATICKET ID");
        if (nftid > 16 ) {
        aufNFT.transferFrom(msg.sender, burnaddr, nftid);
        }
        rooms[rindex].roomID = room_id;
        rooms[rindex].status = Status.ACTIVE;
        rooms[rindex].full = false;
        rooms[rindex].exists = true;
        rooms[rindex].pindex = 0;
        rooms[rindex].bank = 0;
        rooms[rindex].bids_count = 0;
        rooms[rindex].payments_count = 0;
        rooms[rindex].wins = 0;
        rooms[rindex].bids_limit = bidslimit;


        rooms[rindex].players[rooms[rindex].pindex].adr = msg.sender;
        rooms[rindex].players[rooms[rindex].pindex].username = player_name;
        rooms[rindex].players[rooms[rindex].pindex].bidder = false;
        rooms[rindex].players[rooms[rindex].pindex].bids_amount = 0;

        emit RoomCreated(room_id, msg.sender);
        rooms[rindex].pindex++;
        rindex++;    
    }

    function joinRoom(string calldata room_id, string calldata player_name, uint256 nftid) external {

        uint256 rindex_ = findRindex(room_id);
        require(rindex_ != err_rooms, "Room does not exists");
        require(rooms[rindex_].full == false, "Room is full");
        require(rooms[rindex_].status == Status.ACTIVE, "Game started || Room inactive");
        require(aufNFT.ownerOf(nftid) == msg.sender, "You are not owner of this ATICKET ID");

        if (nftid > 16 ) {
        aufNFT.transferFrom(msg.sender, burnaddr, nftid);
        }
        rooms[rindex_].players[rooms[rindex_].pindex].adr = msg.sender;
        rooms[rindex_].players[rooms[rindex_].pindex].username = player_name;
        rooms[rindex_].players[rooms[rindex_].pindex].bidder = false;
        rooms[rindex_].players[rooms[rindex_].pindex].bids_amount = 0;
        emit JoinedToRoom(room_id, msg.sender);
        rooms[rindex_].pindex++;
            if (rooms[rindex_].pindex == max_players) {   
                rooms[rindex_].full = true;
            }
    }

    function Bet(uint256 stake, string calldata room_id) checkBid(stake) onlyPlayer(room_id) external {
        uint256 rindex_ = findRindex(room_id);
        uint256 pindex_ = findPindex(room_id, msg.sender);
        require(pindex_ != err_players, "You are not a player in this room");
        require(rooms[rindex_].status == Status.ACTIVE, "Game started || Room inactive");
        require(aufToken.balanceOf(msg.sender) >= stake, "Not enough tokens");
        aufToken.transferFrom(msg.sender, address(this), stake);
        rooms[rindex_].bids_count ++;
        rooms[rindex_].bank += stake;
        uint256 a = rooms[rindex_].bids_count;
        uint256 b = rooms[rindex_].bank ;
        rooms[rindex_].players[pindex_].bidder = true;
        rooms[rindex_].players[pindex_].bids_amount += stake;
        emit BetPlaced(room_id, a, b);
    }

    function gameStart(string calldata room_id) onlyRoomCreator(room_id) external {
        uint256 rindex_ = findRindex(room_id);
        require(rooms[rindex_].players.length >= min_players, "Must be min. 6 players");
        require(rooms[rindex_].players.length <= rooms[rindex_].bids_count, "All players must place bids");
        rooms[rindex_].status = Status.GAME;
        emit CurrentStatus(room_id, "game");
    }

    function getRewards (string calldata room_id, uint256 winners) onlyPlayer(room_id) external {
        uint256 rindex_ = findRindex(room_id);
        require(rooms[rindex_].status == Status.ACTIVE, "Room inactive");
        require( (winners > 0) && (winners < max_players) );
        if (rooms[rindex_].wins == 0) {
            rooms[rindex_].wins = winners;
        }

        uint256 reward = (rooms[rindex_].bank / rooms[rindex_].wins) - (rooms[rindex_].bank % rooms[rindex_].wins);
        aufToken.transfer(msg.sender, reward);
        rooms[rindex_].payments_count++;
        if (rooms[rindex_].payments_count == rooms[rindex_].wins) {
          rooms[rindex_].status == Status.INACTIVE;  
        }
    }

    function withdrawPlayers (string calldata room_id) onlyOwner external {
        uint256 rindex_ = findRindex(room_id);
        require(rooms[rindex_].status == Status.ACTIVE, "Room inactive");
        require( rooms[rindex_].bank > 0, "Bank is empty" );
        for (uint256 i = 0; i < max_players; i++) { 
            if (rooms[rindex_].players[i].bids_amount > 0) {
                aufToken.transfer(rooms[rindex_].players[i].adr, rooms[rindex_].players[i].bids_amount);
            }
        }

        rooms[rindex_].status == Status.INACTIVE;  

    }


}
